# type: ignore
from pathlib import Path
from time import sleep

from robocorp.tasks import task
from robocorp import log
from contextlib import contextmanager
from somelibrary import call_generators_in_library


def call_method(msg):
    some_assign = msg
    raise RuntimeError(some_assign)


@task
def case_failure():
    """A case which has a known failure"""
    call_method("Error message")


def call_generators():
    yield from range(2)

    for i in range(2):
        yield f"Generated: {i}"


@contextmanager
def check_ctx_manager():
    yield 22


@task
def case_generators():
    """A case which creates generators"""
    for i in call_generators():
        found_var = i

    with check_ctx_manager():
        pass

    for i in call_generators_in_library():
        found_var = i


def add_log_in_method():
    log.info("Some info message")
    log.warn("Some warn message")
    log.critical("Some critical message")


html_img = """<img src="data:image/png;base64," />"""


def add_html_log_in_method():
    log.html(html_img, level="ERROR")
    log.html(html_img, level="WARN")
    log.html(html_img, level="INFO")


def print_in_another():
    import sys

    print("Some message in stdout")
    print("Some message in stderr", file=sys.stderr)


@task
def case_log():
    """A case which creates log entries"""

    add_log_in_method()
    add_html_log_in_method()
    print_in_another()
